import React from 'react';
import Navigation from './Navigation';

const Layout = ({children})=>{
    return(
        <>
            <Navigation />
            <style jsx>{`
                h1{
                    color: red
                }
            `}</style>
            <div>
                {children}
            </div>
        </>
    )
}
export default Layout;
